    <script>
        var swiper1 = new Swiper(".mySwiper", {
            direction: "vertical",
            loop: true,
            centeredSlides: true,
            speed: 1500,
            autoplay: {
                delay: 3500,
                disableOnInteraction: false,
            },
            pagination: {
                el: ".swiper-pagination",
                clickable: true,
            },
            breakpoints: {
                768: {
                    allowTouchMove: true,
                },
                0: {
                    allowTouchMove: false,
                    on: {
                        init: function () {
                            disableSwiperTouchEvents();
                        }
                    }
                }
            }
        });
    
        var swiper2 = new Swiper(".mySwiper2", {
            slidesPerView: 2.5,
            spaceBetween: 10,
            navigation: {
                nextEl: ".swiper-button-next",
                prevEl: ".swiper-button-prev",
            },
            breakpoints: {
                768: {
                    slidesPerView: 2.5,
                },
                0: {
                    slidesPerView: 1.2,
                }
            },
            on: {
                // Hide the prev button when swiper initializes
                init: function() {
                    hidePrevButton();
                },
                // Show the prev button when user interacts with swiper
                slideChange: function() {
                    showPrevButton();
                },
            }
        });
    
        function disableSwiperTouchEvents() {
            const swiperContainer = document.querySelector('.mySwiper');
            swiperContainer.addEventListener('touchstart', preventSwiperTouch, { passive: true });
            swiperContainer.addEventListener('touchmove', preventSwiperTouch, { passive: true });
        }
    
        function preventSwiperTouch(e) {
            if (window.innerWidth < 768) {
                e.preventDefault();
            }
        }
    
        function hidePrevButton() {
            const prevButton = document.querySelector('.swiper-button-prev');
            if (prevButton) {
                prevButton.style.visibility = 'hidden';
            }
        }
    
        function showPrevButton() {
            const prevButton = document.querySelector('.swiper-button-prev');
            if (prevButton) {
                prevButton.style.visibility = 'visible';
            }
        }
    </script>
    
    

    <script>
document.addEventListener('DOMContentLoaded', function() {
    // Open the default tab
    document.getElementById("defaultOpen").click();
    
    // Highlight the first map point
    const firstPoint = document.querySelector('.map__container__point1');
    if (firstPoint) {
        firstPoint.classList.add('active');
    }
});

function openTab(evt, cityName) {
    var i, tabcontent, tablinks;

    // Hide all tab contents
    tabcontent = document.getElementsByClassName("tab-content");
    for (i = 0; i < tabcontent.length; i++) {
        tabcontent[i].style.display = "none";
    }

    // Remove active class from all map points
    tablinks = document.getElementsByClassName("map__container__point");
    for (i = 0; i < tablinks.length; i++) {
        tablinks[i].className = tablinks[i].className.replace(" active", "");
    }

    // Show the selected tab content
    document.getElementById(cityName).style.display = "block";

    // Add active class to the clicked map point
    evt.currentTarget.className += " active";
}

// Map functionality
const pointClassNames = ['.map__container__point1', '.map__container__point2', '.map__container__point3', '.map__container__point4', '.map__container__point5', '.map__container__point6', '.map__container__point7', '.map__container__point8', '.map__container__point9', '.map__container__point10'];

pointClassNames.forEach(className => {
    const point = document.querySelector(className);
    if (point) {
        const svgClassIndex = className.replace('point', 'element');
        const svgPath = document.querySelector(`${svgClassIndex} path:nth-child(1)`);

        // Handle mouse enter event
        point.addEventListener('mouseenter', function() {
            svgPath.style.fill = 'var(--orange)';
        });

        // Handle mouse leave event
        point.addEventListener('mouseleave', function() {
            if (!point.classList.contains('active')) {
                svgPath.style.fill = ''; // Reset to default fill color if not active
            }
        });

        // Handle click event to maintain active state
        point.addEventListener('click', function() {
            // Remove active class from all points
            pointClassNames.forEach(otherClassName => {
                const otherPoint = document.querySelector(otherClassName);
                if (otherPoint) {
                    otherPoint.classList.remove('active');
                    const otherSvgClassIndex = otherClassName.replace('point', 'element');
                    const otherSvgPath = document.querySelector(`${otherSvgClassIndex} path:nth-child(1)`);
                    otherSvgPath.style.fill = ''; // Reset to default fill color
                }
            });

            // Add active class to the clicked point
            point.classList.add('active');
            svgPath.style.fill = 'var(--orange)';
        });
    }
});


    </script>
